response.activities:
- изготовление более 50 позиций запчастей для экскаваторов «КРАНЭКС» («Ивтормаш») МТП-71, МТТ-16, ЕК-220, 270/-03/-05, 400, EU-421, 422, 423 (по заводской технологии — дисконт от заводской цены до 30%);

- продажа стрел, рукоятей, ковшей для техники «КРАНЭКС» — всех серий и размеров;

- продажа техники АМКОДОР — дилер по Ивановской области;

              - для строительных и землеройных работ;

              - для уборки улиц;

              - для уборки снега;

              - для прокладки линий электропередач;

              - для сельского хозяйства;

- продажа навесного оборудования для фронтальных погрузчиков и тракторов;

- продажа капитально восстановленных экскаваторов и кранов МТП-71, МТТ-16, КУ-320, КПТ-1, ЭО-3323, 2626, 2621, 4121

- диагностика, ремонт экскаваторов, тракторов, фронтальных погрузчиков, бульдозеров и др. техники (ВЫЕЗДНОЙ РЕМОНТ);

- выполнение технического обслуживания ДСТ, сервис;

- механическая обработка деталей и узлов по чертежам и образцам, термическая обработка деталей;

- изготовление, продажа и ремонт гидроцилиндров;

- ремонт гидроаппаратуры (гидрораспределителей, гидромоторов, гидронасосов и т.д.);

- продажа гидромолотов, вибротрамбовок, грейферов Delta (пр-ва Южная Корея), а также ГМП-120, МГ-300, НМ-120 и др;

- продажа РВД, РТИ;

- продажа запасных частей для дорожно-строительной техники (ДСТ)

response.about:
Она не покажет ему,что ей больно,а ночью будет долго реветь в подушку;
Она не признается ему в своих чувствах,потому что по личному опыту знает,что так будет лучше;
Она изо всех сил старается ни в кого не влюбляться,хотя и знает,что не сможет удержаться;
Она живёт,чувствуя потребность в выражении собственных мыслей,пусть даже и всего лишь на бумаге;
Она по-прежнему ждёт своего принца,хоть и понимает,что в жизни нет места для иллюзий;
Она верит в вампиров,хотя убеждена,что НЛО нет
Она до сих пор спит с плюшевыми игрушками,так как хочет,чтобы было кого обнимать во сне;
Она ищет свою Настоящую Любовь,хоть и сама уже не сильно в неё верит;
Она безумно хочет хоть на пять минут почувствовать себя любимой;
Она не понаслышке знает,что такое предательство близкого человека;
Она уже много раз сталкивалась со смертью дорогих ей людей;
Она очень дорожит дружбой;
Она-Gabriella Teilor
